import React, { useState} from 'react';
import axios from 'axios';
// Import AuthService without extra spaces or typos
import { AuthService } from './AuthService ';


export default function Register(){

    
    const[txtEmail,setEmail]=useState("");
    const[txtName,setName]=useState("");
    const[txtAddress,setAddress]=useState("");
    const[txtGender,setGender]=useState("");
    const[txtcontactno,setcontactno]=useState("");
    const[txtPassword,setPassword]=useState("");
    const[txtCPassword,setCPassword]=useState("");
    const[txtNic,setNic]=useState("");
    const [fileImage, setImage] = useState();

    

    function sendDataf(e){

        e.preventDefault();

        if (!txtEmail || !txtName || !txtAddress || !txtGender|| !txtcontactno || !txtPassword || !txtCPassword || !txtNic|| fileImage) {
            alert("Please fill in all fields ");
            return;
          }
        
          if (!fileImage) {
            console.error("Image not selected");
            return;
        }

        const formData=new FormData();
        formData.append('image',fileImage);
        formData.append('email',txtEmail);
        formData.append('name',txtName);
        formData.append('password',txtPassword);
        formData.append('address',txtAddress);
        formData.append('nic',txtNic);
        formData.append('contactno',txtcontactno);
        formData.append('gender',txtGender);
        
        console.log(formData);

        axios.post("http://localhost:6060/User/add", formData).then(()=>{
            alert("successfully Registerd");
            console.log("successfully Registerd");
        }).catch((err)=>{
            alert("User not added",err);
            console.log("User not added",err );
        });
        

    }
    
    const backgroundImageUrl = 'http://localhost:6060/images/jeba.png';

    const divStyle = {
    backgroundImage: `url(${backgroundImageUrl})`,
    backgroundRepeat: 'no-repeat',
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    backgroundAttachment: 'fixed',
    // Add other background-related styles as needed
};

    
    return(

      
        <div class="limiter" >
            <div class="container-login100"style={{ ...divStyle, width: "100%", height: "100vh" }}>
              <div class="wrap-login100" style={{marginLeft:"-50%",paddingTop:"10%"}} >

                <form class="login100-form validate-form" onSubmit={sendDataf}>
                  <span  style={{marginLeft:"-80px",fontSize:"32px" ,color:"black",fontWeight:"bolder"}}>
                    Sign <span style={{color:"#fe5b29"}}>In</span>
                  </span>
                  <div class="wrap-input100 validate-input" data-validate = "Password is required">
                    <input  class="form-control"style={{width:"200px",marginLeft:"43%", marginTop:"20px"}} type="text" name="pass" placeholder="name" onChange={(e) => {
                            setName(e.target.value);
                        }}/>
                  </div>

                  <div class="wrap-input100 validate-input" data-validate = "Valid email is required: ex@abc.xyz">
                    <input  class="form-control" style={{width:"200px",marginLeft:"43%", marginTop:"20px"}} type="text" name="email" placeholder="Email" onChange={(e) => {
                            setEmail(e.target.value);
                        }}/>
                  </div>
                  <div class="wrap-input100 validate-input" data-validate = "Password is required">
                    <input  class="form-control"style={{width:"200px",marginLeft:"43%", marginTop:"20px"}} type="text" name="pass" placeholder="Address" onChange={(e) => {
                            setAddress(e.target.value);
                        }}/>
                  </div>
                  <div class="wrap-input100 validate-input" data-validate = "Password is required">
                    <input  class="form-control"style={{width:"200px",marginLeft:"43%", marginTop:"20px"}} type="number" name="pass" placeholder="NIC" onChange={(e) => {
                            setNic(e.target.value);
                        }}/>
                  </div>
                  <div class="wrap-input100 validate-input" data-validate = "Password is required">
                    <select  class="form-control"style={{width:"200px",marginLeft:"43%", marginTop:"20px"}} name="pass" placeholder="Gender" onChange={(e) => {
                            setGender(e.target.value);
                        }}>
                            <option value="Auto">male</option>
                            <option value="Manual">female</option>
                    </select>
                  </div>
                  <div class="wrap-input100 validate-input" data-validate = "Password is required">
                    <input  class="form-control"style={{width:"200px",marginLeft:"43%", marginTop:"20px"}} type="number" name="pass" placeholder="Contact No" onChange={(e) => {
                            setcontactno(e.target.value);
                        }}/>
                  </div>
                  <div class="wrap-input100 validate-input" data-validate = "Password is required">
                    <input  class="form-control"style={{width:"200px",marginLeft:"43%", marginTop:"20px"}} type="file"  onChange={(e) => {
                            setImage(e.target.value);
                        }}/>
                  </div>
                  <div class="wrap-input100 validate-input" data-validate = "Password is required">
                    <input  class="form-control"style={{width:"200px",marginLeft:"43%", marginTop:"20px"}} type="password" name="pass" placeholder="Password" onChange={(e) => {
                            setPassword(e.target.value);
                        }}/>
                  </div>
                  <div class="wrap-input100 validate-input" data-validate = "Password is required">
                    <input  class="form-control"style={{width:"200px",marginLeft:"43%", marginTop:"20px"}} type="password" name="pass" placeholder="Confirm Password" onChange={(e) => {
                            setCPassword(e.target.value);
                        }}/>
                  </div>
                  
                  
                  
                  
                  <div class="container-login100-form-btn">
                            <button type="submit" style={{width:"100px", marginTop:"20px",marginLeft:"-85px", backgroundColor:"#fe5b29"}} class="btn btn-primary mb-3" id="submit">Sign In</button>
                  </div>
                </form>
              </div>
            </div>
	       </div>
      
    )
  }
